information.kick:
The arguments are:

- **member's ID/name** defines the member that will be excluded from the server;
- **reason** defines the reason for the exclusion (This argument is not obligatory).

information.mute:
The arguments are:

- **member's ID/member** defines the member that will be removed from the server;
- **reason** defines the reason why the defined member should be muted (This argument is not obligatory).

information.spigot:
The arguments are:

- **Spigot plugin's ID** searches for a Spigot plugin with its ID;
- **Spigot user** gives a list of Spigot users with similar names to the specified name;
- **plugin's name** gives a list of Spigot plugins with names close to the specified name.

information.tempban:
The arguments are:

- **member's ID/mention** defines the member that will be banned from the server temporarily;
- **days** deletes the messages of the defined member according to the specified number of days which must be equal or lower than 7 otherwise it will be redefined to 7 and the time of existence of the messages of the defined member;
- **ban time** defines the ban time of the defined member equal to or less than 100 years expressed with a number and one of the symbols among s, min, h, d, w, M and y meaning respectively seconds, minutes, hours, days, weeks, months and years;
- **reason** defines the reason for the temporary ban (This argument is not obligatory).

information.unban:
The arguments are:

- **member id/name** defines the member that will be removed from the server;
- **reason** defines the reason for the unbanishment (This argument is not obligatory).

information.unmute:
The arguments are:

- **member id/name** defines the member that will be unmuted;
- **reason** defines the reason why the defined member should be unmuted (This argument is not obligatory).
